import React, { Component } from 'react';

import css from './country.module.css';

export default class Country extends Component {
  render() {
    const { country } = this.props;
    return (
      <div className={css.card}>
        <h4>{country.name}</h4>
        {country.language}
      </div>
    );
  }
}
